import React from 'react'

const Home = () => {

  var styles = {
    h1: {
      width: "1000px",
      position: "absolute",
      top: "27%",
      left: "57%",
      transform: "translate(-50%, -50%)"
    },
    img: {
      position: "absolute",
      right: "-5%"
    }
  }

  return (

    <div class="container">
      <img style={styles.img} src="https://d2gg9evh47fn9z.cloudfront.net/1600px_COLOURBOX1714879.jpg" />
      <h1 class="center" style={styles.h1}>Welcome to Real Estate Broker Application</h1>
    </div>
  );
}

export default Home
